import React from "react";

const Header = () => {

  const handleHeader = () => {
    const headerText = ["Sweetheart", "Stupid"];
    const int = Math.floor(Math.random() * 2);
    return headerText[int];
  };

  const headerStyle = {
        backgroundColor: "purple", 
        color: 'blue'
  }

  return (
    <header style={headerStyle}>
      <h1>Welcome to my page, {handleHeader()}</h1>
    </header>
  );
};

export default Header;
